Definition file as extension.
## jquery.d.ts

``` ts
/// <reference path="jquery.d.ts"/>

...
// require local variable
var param = setting.param
// string or function param
if (typeof param === 'string') {
  // string param
  $().filter(param);
} else {
  // function param
  $().filter(param);
}
```
## jquery.d.ts + jquery.extend.d.ts

``` ts
/// <reference path="jquery.d.ts"/>
/// <reference path="jquery.extend.d.ts"/>

...
// string or function param
$().filter(setting.param);
```

Without DictionaryIterator the simplest code is impossible to write:

var myDictionary : {[x:string]: string;}

_.filter(myDictionary, (v, k, c) => { return k == "A"; })
